import React from "react";
import { Link } from "react-router-dom";

import { Header, Footer } from "../components/index";

const Connect = () => {
  return (
    <div>
      <Header />

      <div className="row">
        <div className="col-12">
          <div className="tabs p-3">
            <div className="farmer-list">
              <h2></h2>
            </div>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default Connect;
